$(function () {
    $('.btn-keywords').click(function () {
        if ($(this).attr('data-fold') == 0) {
            $(this).html('+ 更多');
            $('.footer-keywords-list').animate({
                'height': 20
            });
            $(this).attr('data-fold', 1);
        } else {
            $(this).html('- 收起');
            $('.footer-keywords-list').animate({
                'height': 60
            });
            $(this).attr('data-fold', 0);
        }
    });
});

